import React from 'react';

const Block = (props) => {
    return (
        <div className="text-light">

            <p>{props.title}</p>


            {

             props.mesCoordonee.map((item)=>{
                 return(
                    <div>
                        <i class='far fa-envelope-open'></i>
                        {item.img}
                        {item.value}
                    </div>
                 )
             })


            }

        </div>
    );
};

export default Block;
